==POV tag==
This concerns POV tag cleanup.  Whenever an POV tag is placed, it is necessary to also post a message in the discussion section stating clearly why it is thought the article does not comply with POV guidelines, and suggestions for how to improve it.  This permits discussion and consensus among editors.  From WP tag policy: '''Drive-by tagging is strongly discouraged. The editor who adds the tag must address the issues on the talk page, pointing to specific issues that are actionable within the content policies, namely Wikipedia:Neutral point of view, Wikipedia:Verifiability, Wikipedia:No original research and Wikipedia:Biographies of living persons. Simply being of the opinion that a page is not neutral is not sufficient to justify the addition of the tag. Tags should be added as a last resort.'''  Better yet, edit the topic yourself with the improvements.  This statement is not a judgement of content, it is only a cleanup of frivolously and/or arbitrarily placed tags.  No discussion, no tag.[[User:Jjdon|Jjdon]] ([[User talk:Jjdon|talk]]) 22:12, 30 April 2008 (UTC)
